      text: ""
    };
  }

  handleChange = (e) => {
    this.setState({
      text: e.target.value
    });
  };

  // create handleAdd and handleRemove functions here

  render() {
    return (
      <div className="App">
        <span>Todo</span>
        <Form />
        <List />
      </div>
    );
  }
}
